-- ----------------------------
-- Table structure for wr_basic_auth
-- ----------------------------
DROP TABLE IF EXISTS `wr_basic_auth`;
CREATE TABLE `wr_basic_auth` (
  `id` varchar(255) NOT NULL COMMENT '主键(新增操作忽略，更新操作必填)',
  `sys_user_id` varchar(255) NOT NULL COMMENT '用户表关联ID',
  `user_name` varchar(64) NOT NULL COMMENT '账号',
  `user_mobile` varchar(11) DEFAULT NULL COMMENT '手机号',
  `user_email` varchar(64) DEFAULT NULL COMMENT '邮箱',
  `pass_word` varchar(32) NOT NULL COMMENT '密码',
  `salt` varchar(64) NOT NULL COMMENT '盐',
  `person_num` varchar(16) NOT NULL COMMENT '用户编号（例：学生有学号，教师有工号）',
  `last_login_time` datetime DEFAULT NULL COMMENT '最后一次登录时间',
  `is_locked` char(1) DEFAULT '0' COMMENT '是否锁定，1：锁定，0未锁定',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `is_delete` char(1) DEFAULT '0' COMMENT '是否删除（0：未删除，1：删除）',
  `delete_time` datetime DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `sys_user_id_uniqueIndex` (`sys_user_id`) USING BTREE,
  UNIQUE KEY `user_name_uniqueIndex` (`user_name`) USING BTREE,
  UNIQUE KEY `person_num_uniqueIndex` (`person_num`) USING BTREE,
  UNIQUE KEY `user_mobile_uniqueIndex` (`user_mobile`) USING BTREE,
  UNIQUE KEY `user_email_uniqueIndex` (`user_email`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户登录基础认证表';

