DROP TABLE IF EXISTS `wr_examination_hall`;
CREATE TABLE `wr_examination_hall` (
  `id` varchar(255) NOT NULL COMMENT '主键(新增操作忽略，更新操作必填)',
  `hall_code` varchar(255) NOT NULL COMMENT '考场编号',
  `exam_subjects_name` varchar(255) NOT NULL COMMENT '该考场考试科目名称',
  `examinee_count` int(11) DEFAULT NULL COMMENT '考生人数',
  `start_time` datetime NOT NULL COMMENT '开始时间',
  `end_time` datetime NOT NULL COMMENT '结束时间',
  `exam_status` varchar(32) DEFAULT '0' COMMENT '考试状态，默认''0''。-1：已结束，0：未开始，1：进行中',
  `class_id` varchar(255) DEFAULT NULL COMMENT '该考场所属组织',
  `student_login_time` int(11) NOT NULL COMMENT '学生登录考试时间，是个数字，比如10，代表在考试开始前10分钟之后才允许考生登录',
  `Invigilators_login_time` int(11) NOT NULL COMMENT '监考员登录监考时间，是个数字，比如10，代表在考试开始前10分钟之后才允许监考员登录监考',
  `show_album` char(1) NOT NULL DEFAULT '1' COMMENT '显示专辑，0：不显示 1：显示（每条考场数据对应一个视频集合，即专辑。该考场对应的视频专辑默认是显示，若人为手动删除专辑则show_album置为''0''）',
  `create_id` varchar(255) NOT NULL COMMENT '创建人id，用于连表不用于显示',
  `create_by` varchar(32) NOT NULL COMMENT '创建人账号，不建议填名字，账号更改的可能性很小且又比ID稍微形象化',
  `create_way` varchar(2) NOT NULL DEFAULT '0' COMMENT '创建方式（0：程序代码创建，1：导入创建）',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `is_delete` char(1) DEFAULT '0' COMMENT '是否删除（0：未删除，1：删除）',
  `delete_time` datetime DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='考场考试表';

