DROP TABLE IF EXISTS `wr_examinee`;
CREATE TABLE `wr_examinee` (
  `id` varchar(255) NOT NULL COMMENT '主键(新增操作忽略，更新操作必填)',
  `examination_hall_id` varchar(255) NOT NULL COMMENT '考场考试id',
  `examination_hall_code` varchar(255) NOT NULL COMMENT '考场编号',
  `student_code` varchar(64) NOT NULL COMMENT '学号',
  `student_name` varchar(64) NOT NULL COMMENT '学生姓名',
  `student_status` varchar(255) DEFAULT '0' COMMENT '学生考试状态，默认''0''。0：未参加，1：已参加（此状态由客户端去控制）',
  `login_time` datetime DEFAULT NULL COMMENT '登陆时间',
  `exit_time` datetime DEFAULT NULL COMMENT '退出时间',
  `live_address_push` varchar(255) DEFAULT NULL COMMENT '直播地址推流，流媒体推流地址应为“固定前缀+hall_code+''_''+student_code”',
  `live_address_pull` varchar(255) DEFAULT NULL COMMENT '直播地址拉流，流媒体推流地址应为“固定前缀+hall_code+''_''+student_code”',
  `create_id` varchar(255) NOT NULL COMMENT '创建人id，用于连表不用于显示',
  `create_by` varchar(32) NOT NULL COMMENT '创建人账号，不建议填名字，账号更改的可能性很小且又比ID稍微形象化',
  `create_way` varchar(2) NOT NULL DEFAULT '0' COMMENT '创建方式（0：程序代码创建，1：导入创建）',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `is_delete` char(1) DEFAULT '0' COMMENT '是否删除（0：未删除，1：删除）',
  `delete_time` datetime DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='考生信息表';

