DROP TABLE IF EXISTS `wr_exam_video`;
CREATE TABLE `wr_exam_video` (
  `id` varchar(255) NOT NULL COMMENT '主键(新增操作忽略，更新操作必填)',
  `examination_hall_id` varchar(255) NOT NULL COMMENT '考场考试id',
  `examination_hall_code` varchar(255) NOT NULL COMMENT '考场编号',
  `examinee_id` varchar(255) NOT NULL COMMENT '考生信息id',
  `student_code` varchar(64) NOT NULL COMMENT '考生学号',
  `original_file` varchar(255) DEFAULT NULL COMMENT '原始名称，上传时的名称',
  `video_name` varchar(255) DEFAULT NULL COMMENT '视频名称',
  `video_path` varchar(255) DEFAULT NULL COMMENT '视频存储路径',
  `video_duration` varchar(255) DEFAULT NULL COMMENT '视频时长',
  `video_cover_img` varchar(255) DEFAULT NULL COMMENT '视频封面图片',
  `video_size` bigint(20) DEFAULT NULL COMMENT '视频大小',
  `video_status` varchar(255) DEFAULT NULL COMMENT '视频状态，1：录制中 2：录制完成 3：切片中 4：切片完成',
  `watch_count` bigint(20) DEFAULT '0' COMMENT '观看次数',
  `exam_abnormal` char(1) DEFAULT '0' COMMENT '考试期间是否有异常，0：无异常 1：有异常 ',
  `abnormal_millis` varchar(255) DEFAULT NULL COMMENT '考试异常时间点，是个毫秒级时间戳，可换算成#分#秒，提示时需加''约''字，如：约07分21秒前后',
  `abnormal_time` datetime DEFAULT NULL COMMENT '考试异常时间点，是考试当天打点的时间，录制视频内一旦存在时间水印可准确查找',
  `create_id` varchar(255) NOT NULL COMMENT '创建人id，用于连表不用于显示',
  `create_by` varchar(32) NOT NULL COMMENT '创建人账号，不建议填名字，账号更改的可能性很小且又比ID稍微形象化',
  `create_way` varchar(2) NOT NULL DEFAULT '0' COMMENT '创建方式（0：程序代码创建，1：导入创建）',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `is_delete` char(1) DEFAULT '0' COMMENT '是否删除（0：未删除，1：删除）',
  `delete_time` datetime DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='考试(考生)视频表';

