-- ----------------------------
-- Table structure for wr_sch_course_table_live
-- ----------------------------
DROP TABLE IF EXISTS `wr_sch_course_table_live`;
CREATE TABLE `wr_sch_course_table_live` (
  `id` varchar(255) NOT NULL COMMENT '主键(新增操作忽略，更新操作必填)',
  `sch_course_table_base_id` varchar(255) NOT NULL COMMENT '学校基础课程表ID，外键',
  `course_desc` varchar(255) DEFAULT NULL COMMENT '课堂简介',
  `weeks` int(11) NOT NULL COMMENT '周数，如：1、2、5、18等',
  `date_for_weeks` date NOT NULL COMMENT '周数+星期几所对应的日期，如：第18周的星期二对应的日期为yyyy-MM-dd',
  `is_record` char(1) NOT NULL DEFAULT '0' COMMENT '是否录制，默认否（0：否，1：是）',
  `plan_form` varchar(255) NOT NULL COMMENT '计划来源，1_1：基础课表自动生成、1_1：基础课表自定义创建、2_1：其它',
  `plan_creator` varchar(32) NOT NULL COMMENT '计划创建人，填名字，如：张三',
  `is_cancel` char(1) NOT NULL DEFAULT '0' COMMENT '是否取消，默认否（0：未取消，1：已取消）',
  `create_id` varchar(255) NOT NULL COMMENT '创建人id，用于连表不用于显示',
  `create_by` varchar(32) NOT NULL COMMENT '创建人账号，不建议填名字，账号更改的可能性很小且又比ID稍微形象化',
  `create_way` varchar(2) NOT NULL DEFAULT '0' COMMENT '创建方式（0：程序代码创建，1：导入创建）',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `is_delete` char(1) DEFAULT '0' COMMENT '是否删除（0：未删除，1：删除）',
  `delete_time` datetime DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `sch_course_table_base_id_weeks_uniqueIndex` (`sch_course_table_base_id`,`weeks`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='学校课程表-直播计划表，数据来源学校课程表基础表，基础表内一条数据对应本表内多条数据，如：基础表id=1的1-6周有课，则本表最多会产生6条对应数据，每个周都会被分割成单独一条记录';

-- ----------------------------
-- Records of wr_sch_course_table_live
-- ----------------------------

-- ----------------------------
-- Table structure for wr_sch_device
-- ----------------------------
DROP TABLE IF EXISTS `wr_sch_device`;
CREATE TABLE `wr_sch_device` (
  `id` varchar(255) NOT NULL COMMENT '主键(新增操作忽略，更新操作必填)',
  `sch_space_id` varchar(255) NOT NULL COMMENT '学校空间信息id',
  `serial_number` varchar(255) DEFAULT NULL COMMENT '设备序列号',
  `device_name` varchar(255) NOT NULL COMMENT '设备名称',
  `device_location` varchar(255) NOT NULL COMMENT '设备位置描述，以讲台方向为北，NW：西北角，N：正北，NE：东北角，W：正西，C：教室正中心，E：正东，SW：西南角、S：正南、SE：东南角，CNW：西北中，CNE：东北中，CSE：东南中，CSW：西南中，PF：讲台，OT：其它',
  `device_type` char(8) NOT NULL COMMENT '设备类型，1：摄像机，2：讲台计算机，overlay：合成流',
  `access_protocol` char(1) DEFAULT NULL COMMENT '接入协议，1：海康，2：大华，3：ONVIF',
  `ip_addr` varchar(255) DEFAULT NULL COMMENT '设备ip地址',
  `access_user` varchar(255) DEFAULT NULL COMMENT '访问用户名',
  `access_pwd` varchar(255) DEFAULT NULL COMMENT '访问密码',
  `rtsp_url_main` varchar(255) DEFAULT NULL COMMENT 'rtsp主码流地址',
  `rtsp_url_sub` varchar(255) DEFAULT NULL COMMENT 'rtsp子码流地址',
  `rtmp_get_url` varchar(255) NOT NULL COMMENT 'rtmp流地址',
  `flv_get_url` varchar(255) NOT NULL COMMENT 'flv流地址',
  `hls_get_url` varchar(255) NOT NULL COMMENT 'HLS流地址',
  `connect_status` char(1) DEFAULT '0' COMMENT '设备连接状态，默认离线，0：离线(红)，1：在线(绿)',
  `is_support_control` char(1) DEFAULT '0' COMMENT '设备本身是否支持云台控制，0：不支持，1：支持',
  `is_support_absolute_move` char(1) DEFAULT '0' COMMENT '是否支持绝对移动(前提为‘是否支持云台控制=1’)，0：不支持，1：支持',
  `is_support_continuous_move` char(1) DEFAULT '0' COMMENT '是否支持连续移动(前提为‘是否支持云台控制=1’)，0：不支持，1：支持',
  `is_enable_control` char(1) DEFAULT '0' COMMENT '是否启用云台控制，默认未启用，0：未启用，1：启用',
  `is_active` char(1) NOT NULL DEFAULT '1' COMMENT '是否激活设备，默认激活，相对范围是平台系统而不是设备本身，激活后在平台系统业务操作范围中可见，反之不可见。0：未激活，1：激活',
  `onvif_user` varchar(255) DEFAULT NULL COMMENT 'onvif用户名',
  `onvif_pwd` varchar(255) DEFAULT NULL COMMENT 'onvif密码',
  `create_id` varchar(255) NOT NULL COMMENT '创建人id，用于连表不用于显示',
  `create_by` varchar(32) NOT NULL COMMENT '创建人',
  `create_way` varchar(2) NOT NULL DEFAULT '0' COMMENT '创建方式（0：程序代码创建，1：导入创建）',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `is_delete` varchar(2) DEFAULT '0' COMMENT '是否删除（0：未删除，1：删除）',
  `delete_id` varchar(255) DEFAULT NULL COMMENT '删除人id，用于连表不用于显示',
  `delete_by` varchar(32) DEFAULT NULL COMMENT '删除人',
  `delete_time` datetime DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `rtmp_get_url_uniqueIndex` (`rtmp_get_url`) USING BTREE,
  UNIQUE KEY `flv_get_url_uniqueIndex` (`flv_get_url`) USING BTREE,
  UNIQUE KEY `hls_get_url_uniqueIndex` (`hls_get_url`) USING BTREE,
  UNIQUE KEY `sch_space_id_device_location_uniqueIndex` (`sch_space_id`,`device_location`) USING BTREE COMMENT 'school_space_id和device_location_uniqueIndex',
  UNIQUE KEY `ip_addr_uniqueIndex` (`ip_addr`) USING BTREE,
  UNIQUE KEY `rtsp_url_main_uniqueIndex` (`rtsp_url_main`) USING BTREE,
  UNIQUE KEY `rtsp_url_sub_uniqueIndex` (`rtsp_url_sub`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='学校设备信息表，如：摄像机、讲台计算机等';

-- ----------------------------
-- Records of wr_sch_device
-- ----------------------------

-- ----------------------------
-- Table structure for wr_sch_grade_class
-- ----------------------------
DROP TABLE IF EXISTS `wr_sch_grade_class`;
CREATE TABLE `wr_sch_grade_class` (
  `id` varchar(255) NOT NULL COMMENT '主键(新增操作忽略，更新操作必填)',
  `grade_year` int(4) NOT NULL COMMENT '入学年份(年级年份)，如：2010',
  `grade_name` int(255) DEFAULT NULL COMMENT '年级名称，1：一年级、2：二年级、3：三年级、4：四年级、5：五年级、6：六年级、7：初一、8：初二、9：初三、10：高一、11：高二、12：高三、13：大一、14：大二、15：大三、16：大四、17：大五、18：大六',
  `class_name` varchar(255) NOT NULL COMMENT '班级名称，如：1班、二班、计算机1201班等',
  `create_id` varchar(255) NOT NULL COMMENT '创建人id，用于连表不用于显示',
  `create_by` varchar(32) NOT NULL COMMENT '创建人账号，不建议填名字，账号更改的可能性很小且又比ID稍微形象化',
