-- ----------------------------
-- Table structure for wr_sch_semester
-- ----------------------------
DROP TABLE IF EXISTS `wr_sch_semester`;
CREATE TABLE `wr_sch_semester` (
  `id` varchar(255) NOT NULL COMMENT '主键(新增操作忽略，更新操作必填)',
  `sem_code` varchar(32) NOT NULL COMMENT '学期编码，默认规则为"开始学年-结束学年-学期编号”，如：2012-2013-1',
  `school_year_start` int(4) NOT NULL COMMENT '开始学年，如：2012',
  `school_year_end` int(4) NOT NULL COMMENT '结束学年，如：2013',
  `sem_num` int(2) NOT NULL COMMENT '学期编号，1：第一学期，2：第二学期',
  `sem_date_start` date NOT NULL COMMENT '学期开始日期，如：2012-02-28',
  `sem_date_end` date NOT NULL COMMENT '学期结束日期，如：2012-07-01',
  `total_weeks` int(11) NOT NULL COMMENT '学期总周数，如：22',
  `is_current_sem` char(1) NOT NULL COMMENT '是否当前学期，注意同一学年只允许存在一个当前学期；0：否，1：是',
  `create_id` varchar(255) NOT NULL COMMENT '创建人id，用于连表不用于显示',
  `create_by` varchar(32) NOT NULL COMMENT '创建人账号，不建议填名字，账号更改的可能性很小且又比ID稍微形象化',
  `create_way` varchar(2) NOT NULL DEFAULT '0' COMMENT '创建方式（0：程序代码创建，1：导入创建）',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `is_delete` char(1) DEFAULT '0' COMMENT '是否删除（0：未删除，1：删除）',
  `delete_time` datetime DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `sem_code_uniqueIndex` (`sem_code`) USING BTREE,
  UNIQUE KEY `school_year_start_end_sem_num_uniqueIndex` (`school_year_start`,`school_year_end`,`sem_num`) USING HASH
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='学校学期表，如：开始结束学年、开始结束学期、总周数等';

-- ----------------------------
-- Records of wr_sch_semester
-- ----------------------------

-- ----------------------------
-- Table structure for wr_sch_space
-- ----------------------------
DROP TABLE IF EXISTS `wr_sch_space`;
CREATE TABLE `wr_sch_space` (
  `id` varchar(255) NOT NULL COMMENT '主键(新增操作忽略，更新操作必填)',
  `parent_id` varchar(255) NOT NULL COMMENT '父结点id，选中左侧节点时可以获取到',
  `parent_ids` varchar(255) NOT NULL COMMENT '父结点id列表串，由后台系统代码自动生成',
  `space_code` varchar(255) NOT NULL COMMENT '空间编码，一般为空间名称的缩写，汉字拼音首字母大写，字母数字则不变，不允许带中文，同一父级下不允许重复。\r\n如：\r\n教学楼A编码为JXLA，A101编码为A101，则JXLA下不允许有两个A101、\r\n本部校区编码为BBXQ，教学楼A编码为JXLA，则BBXQ下不允许有两个JXLA',
  `parent_space_code` varchar(255) NOT NULL COMMENT '父节点空间编码',
  `parent_space_codes` varchar(255) NOT NULL COMMENT '父节点空间编码列表串，由后台系统代码自动生成',
  `space_name` varchar(255) NOT NULL COMMENT '空间名称(教学楼名称或班级门牌号)',
  `parent_space_name` varchar(255) NOT NULL COMMENT '父节点空间名称',
  `parent_space_names` varchar(255) NOT NULL COMMENT '父节点空间名称列表串，由后台系统代码自动生成',
  `space_alias` varchar(255) DEFAULT NULL COMMENT '空间名称别名',
  `space_type` char(1) NOT NULL COMMENT '空间类型，1：学校，2：校区，3：楼宇，4：楼层，5：教室',
  `sort_num` int(11) NOT NULL COMMENT '排序号',
  `create_id` varchar(255) NOT NULL COMMENT '创建人id，用于连表不用于显示',
  `create_by` varchar(32) NOT NULL COMMENT '创建人',
  `create_way` varchar(2) NOT NULL DEFAULT '0' COMMENT '创建方式（0：程序代码创建，1：导入创建）',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `is_delete` varchar(2) DEFAULT '0' COMMENT '是否删除（0：未删除，1：删除）',
  `delete_id` varchar(255) DEFAULT NULL COMMENT '删除人id，用于连表不用于显示',
  `delete_by` varchar(32) DEFAULT NULL COMMENT '删除人',
  `delete_time` datetime DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `space_code_parent_space_codes_uniqueIndex` (`space_code`,`parent_space_codes`) USING BTREE COMMENT 'space_code和parent_space_codes_uniqueIndex',
  UNIQUE KEY `space_name_parent_space_names_uniqueIndex` (`space_name`,`parent_space_names`) USING BTREE COMMENT 'space_name和parent_space_names_uniqueIndex'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='学校空间信息表，如：校区、楼、教室';

