  `create_by` varchar(32) NOT NULL COMMENT '创建人账号，不建议填名字，账号更改的可能性很小且又比ID稍微形象化',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统级-部门用户表';

-- ----------------------------
-- Records of wr_sys_department_user
-- ----------------------------

-- ----------------------------
-- Table structure for wr_sys_permission
-- ----------------------------
DROP TABLE IF EXISTS `wr_sys_permission`;
CREATE TABLE `wr_sys_permission` (
  `id` varchar(255) NOT NULL COMMENT '主键(新增操作忽略，更新操作必填)',
  `name` varchar(128) NOT NULL COMMENT '资源名称',
  `type` varchar(32) NOT NULL COMMENT '资源类型，1：一级菜单，2：二级菜单，button：按钮，btn_menu：按钮菜单(内联菜单)',
  `url` varchar(128) DEFAULT NULL COMMENT '访问url地址；无实际url可不填，如：父菜单；',
  `percode` varchar(128) DEFAULT NULL COMMENT '权限代码字符串，填写规则“模块页面英文:操作类型英文”，例：用户管理页面的增加按钮 -> user:create（可用来判断是否拥有该权限,避免拿汉字来判断）',
  `parent_id` varchar(255) DEFAULT NULL COMMENT '父结点id，选中左侧菜单树节点时可以获取到',
  `parent_ids` varchar(255) DEFAULT NULL COMMENT '父结点id列表串，由后台系统代码自动生成',
  `sort_num` int(11) DEFAULT NULL COMMENT '排序号',
  `ascription_type` varchar(3) NOT NULL COMMENT '归属类型，1：后端平台的菜单，2：前端平台的菜单',
  `icon_style` varchar(255) DEFAULT NULL COMMENT '图标样式',
  `icon_url` varchar(255) DEFAULT NULL COMMENT '图标地址',
  `is_locked` char(1) DEFAULT '0' COMMENT '是否锁定，1：锁定，0未锁定',
  `create_id` varchar(255) NOT NULL COMMENT '创建人id，用于连表不用于显示',
  `create_by` varchar(32) NOT NULL COMMENT '创建人账号，不建议填名字，账号更改的可能性很小且又比ID稍微形象化',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `is_delete` char(1) DEFAULT '0' COMMENT '是否删除（0：未删除，1：删除）',
  `delete_time` datetime DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `percode_uniqueIndex` (`percode`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='系统级-资源权限表，本表是资源表(如菜单)及权限表(如增删改查导入导出等)的合表';

-- ----------------------------
-- Records of wr_sys_permission
-- ----------------------------

-- ----------------------------
-- Table structure for wr_sys_role
-- ----------------------------
DROP TABLE IF EXISTS `wr_sys_role`;
CREATE TABLE `wr_sys_role` (
  `id` varchar(255) NOT NULL COMMENT '主键(新增操作忽略，更新操作必填)',
  `role_name` varchar(128) NOT NULL COMMENT '角色名称',
  `role_code` varchar(255) DEFAULT NULL COMMENT '角色编码，自定义角色无编写限制，内置角色需以"built_in_"开头，如：built_in_teacher',
  `role_desc` varchar(255) DEFAULT NULL COMMENT '角色具体描述',
  `role_type` varchar(32) DEFAULT NULL COMMENT '角色类型，1：内置角色，系统上线前就需要提前知道的角色 2：自定义角色',
  `is_locked` char(1) DEFAULT '0' COMMENT '是否锁定，1：锁定，0未锁定',
  `create_id` varchar(255) NOT NULL COMMENT '创建人id，用于连表不用于显示',
  `create_by` varchar(32) NOT NULL COMMENT '创建人账号，不建议填名字，账号更改的可能性很小且又比ID稍微形象化',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `is_delete` char(1) DEFAULT '0' COMMENT '是否删除（0：未删除，1：删除）',
  `delete_time` datetime DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `role_code_uniqueIndex` (`role_code`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='系统级-角色表';

-- ----------------------------
-- Records of wr_sys_role
-- ----------------------------

-- ----------------------------
-- Table structure for wr_sys_role_permission
-- ----------------------------
DROP TABLE IF EXISTS `wr_sys_role_permission`;
CREATE TABLE `wr_sys_role_permission` (
  `id` varchar(255) NOT NULL COMMENT '主键(新增操作忽略，更新操作必填)',
  `sys_role_id` varchar(255) NOT NULL COMMENT '角色id',
