-- ----------------------------
-- Table structure for wr_sys_static_param
-- ----------------------------
DROP TABLE IF EXISTS `wr_sys_static_param`;
CREATE TABLE `wr_sys_static_param` (
  `id` varchar(255) NOT NULL COMMENT '主键(新增操作忽略，更新操作必填)',
  `parent_id` varchar(255) NOT NULL COMMENT '父结点id，选中左侧节点时可以获取到',
  `param_name` varchar(255) NOT NULL COMMENT '参数名称',
  `param_val` varchar(255) DEFAULT NULL COMMENT '参数值',
  `param_desc` varchar(255) NOT NULL COMMENT '参数描述，用来解释这个参数代表什么意思，展示给用户看的',
  `show_type` char(1) NOT NULL COMMENT '展示类型（0：未知，1：span文本，2：text输入框，3：img图像，4：img图像列表）',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注，开发人员自己看的，不需要展示',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='平台系统静态参数表，如:网站icon、网站title、前台网页左上角logo、前台网页左上角logo旁的title等等的静态参数';

-- ----------------------------
-- Records of wr_sys_static_param
-- ----------------------------

-- ----------------------------
-- Table structure for wr_sys_user
-- ----------------------------
DROP TABLE IF EXISTS `wr_sys_user`;
CREATE TABLE `wr_sys_user` (
  `id` varchar(255) NOT NULL COMMENT '主键(新增操作忽略，更新操作必填)',
  `person_name` varchar(32) NOT NULL COMMENT '姓名(人名)',
  `nickname` varchar(16) DEFAULT NULL COMMENT '昵称',
  `sex` char(1) DEFAULT '0' COMMENT '性别，1:男，2:女，0：未知',
  `age` int(11) DEFAULT NULL COMMENT '年龄',
  `birthday` date DEFAULT NULL COMMENT '生日',
  `person_num` varchar(16) NOT NULL COMMENT '用户编号（例：学生有学号，教师有工号）',
  `position` varchar(16) DEFAULT NULL COMMENT '职称/职位',
  `profile` varchar(255) DEFAULT NULL COMMENT '个人简介',
  `head_img_url` varchar(255) DEFAULT NULL COMMENT '头像url',
  `is_registered` varchar(2) DEFAULT '0' COMMENT '是否注册，1：注册，0未注册，-1已注销',
  `is_locked` char(1) DEFAULT '0' COMMENT '是否锁定，1：锁定，0未锁定',
  `create_id` varchar(255) NOT NULL COMMENT '创建人id，用于连表不用于显示',
  `create_by` varchar(32) NOT NULL COMMENT '创建人账号，不建议填名字，账号更改的可能性很小且又比ID稍微形象化',
  `create_way` varchar(2) NOT NULL DEFAULT '0' COMMENT '创建方式（0：程序代码创建，1：导入创建）',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `is_delete` char(1) DEFAULT '0' COMMENT '是否删除（0：未删除，1：删除）',
  `delete_time` datetime DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `person_num_uniqueIndex` (`person_num`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='系统级-用户表';

-- ----------------------------
-- Records of wr_sys_user
-- ----------------------------

