  `publish_type` varchar(32) NOT NULL COMMENT '推流类型，sw：软件，rpm：录播机RecordPlayMachine',
  `enable_sign_auth` char(1) NOT NULL COMMENT '启用sign鉴权码，1：启用，0：未启用(注：publish_type=sw必须启用)',
  `is_locked` char(1) DEFAULT '0' COMMENT '是否锁定，1：锁定，0未锁定',
  `create_id` varchar(255) NOT NULL COMMENT '创建人id，用于连表不用于显示',
  `create_by` varchar(32) NOT NULL COMMENT '创建人账号，不建议填名字，账号更改的可能性很小且又比ID稍微形象化',
  `create_way` varchar(2) NOT NULL DEFAULT '0' COMMENT '创建方式（0：程序代码创建，1：导入创建）',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `is_delete` char(1) DEFAULT '0' COMMENT '是否删除（0：未删除，1：删除）',
  `delete_time` datetime DEFAULT NULL COMMENT '删除时间',
